import React from "react";

let id=0;
const Recipe= ({id, name,diets,image, summary,healthScore, steps})=>{
    return (
        <div>
            {
                typeof id === "string" ? 
                    <ul>
                        <p>{name}</p>
                        <img src={image} alt="recipe" />
                        <p>{summary}</p>
                        <p>{diets.map(d=> <li key={d.id}>{d.name}</li>)}</p>
                        <p>{healthScore}</p>
                        <p>{steps}</p>
                    </ul> 
                :
                <div>
                    <p>{name}</p>
                    <img src={image} alt="recipe"/>
                    {/* {diets.map(d=><div>{d}</div>)} */}

                </div>
            }

        </div>
    )
}   

export default Recipe;
